                posts.map((post, index) => (
                    <Card
                    key={index}
                    id={post.id}
                    title={post.title}
                    author={post.author}
                    createdAt={post.created_at}
                    />
                )) : <h2 style={{ color: 'black' }}>{'No Posts Yet ðŸ˜ž'}</h2>}        </div>
    )
}

